Créer une commande eightball qui prends en argument une chaîne de caractère et qui renvoie une réponse aléatoire parmi une liste de réponses. Par exemple, si on appelle la commande avec la chaîne de caractère Est-ce que je vais réussir mon examen ?, la commande doit renvoyer une réponse aléatoire parmi une liste de réponses. La liste de réponses est la suivante : responses = [ "It is certain," "It is decidedly so," "Without a doubt," "Yes definitely," "You may rely on it," "As I see it," "yes," "Most likely," "Outlook good," "Yes," "Signs point to yes," "Don't count on it," "My reply is no," "My sources say no," "Outlook not so good," "Very doubtful," "Reply hazy try again," "Ask again later," "Better not tell you now," "Cannot predict now," "Concentrate and ask again"
] (On peut utiliser la fonction random.choice pour obtenir un élément aléatoire d'une liste.) Solution import random @bot.command()
async def eightball(ctx : commands.Context, *, question : str) -> None: responses = [ "It is certain," "It is decidedly so," "Without a doubt," "Yes definitely," "You may rely on it," "As I see it," "yes," "Most likely," "Outlook good," "Yes," "Signs point to yes," "Don't count on it," "My reply is no," "My sources say no," "Outlook not so good," "Very doubtful," "Reply hazy try again," "Ask again later," "Better not tell you now," "Cannot predict now," "Concentrate and ask again" ] await ctx.send(f"Question: {question}\nAnswer: {random.choice(responses)}")
